    "2016-04-06T23:20:01.161117",nt"name": "national-drug-code-directory",nt"isopen":
    true,nt"url": null,nt"notes": "<p>The Drug Listing Act of 1972 requires
    registered drug establishments to provide the Food and Drug Administration (FDA)
    with a current list of all drugs manufactured, prepared, propagated, compounded,
    or processed by it for commercial distribution. (See Section 510 of the Federal
    Food, Drug, and Cosmetic Act (Act) (21 U.S.C. u00a7 360)). Drug products are identified
    and reported using a unique, three-segment number, called the National Drug Code
    (NDC), which serves as a universal product identifier for drugs. FDA publishes the
    listed NDC numbers and the information submitted as part of the listing information
    in the NDC Directory which is updated daily.</p>n",nt"license_title": "Other
